DROP TABLE IF EXISTS `porres`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `porres` (
  `idporra` int(11) NOT NULL AUTO_INCREMENT,
  `golslocal` int(11) DEFAULT NULL,
  `golsvisitant` int(11) DEFAULT NULL,
  `data` datetime DEFAULT NULL,
  `idsgolejadorslocal` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idsgolejadorsvisitant` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idpenyista` int(11) DEFAULT NULL,
  `idpartit` int(11) DEFAULT NULL,
  PRIMARY KEY (`idporra`),
  KEY `idpenyista` (`idpenyista`),
  KEY `idpartit` (`idpartit`),
